import React from "react";
import { connect } from "react-redux";

function Grid(props) {
  return <img src={props.cards[0].src} alt="" />;
}

const mapStateToProps = (state) => ({
  cards: state.cards,
});

export default connect(mapStateToProps)(Grid);
